import React from 'react';
import facebookLogo from '../facebook.svg';
import homeSvg from '../house-solid.svg';
import videoSvg from '../video-solid.svg';
import gameSvg from '../sports_esports_black_24dp.svg';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';
export default function Navbar() {
  return (
    <div>
      <nav>
        <div className='row row-cols-4'>
            <div>
               <i><img src={facebookLogo} alt='icon facebak'/></i>
               <input type='search' placeholder='Rechercher sur facebak'></input>
            </div>
            <div>
               <i><img src={homeSvg} alt='home icon'/></i>
            </div>
            <div>
                <i><img src={videoSvg} alt='video icon'/></i>
            </div>
            <div>
                <i><img src={gameSvg} alt='gaming icon'/></i>
            </div>
        </div>
      </nav>
    </div>
  );
}
